import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './components/Home.jsx';
import Event from './components/Events.jsx';
//import Book from './components/Booking.jsx';
//import Log from './components/Login.jsx';
import logo from './DK KD Logo.jpg';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <div className="navibar">
          <img className="logo" src={logo} alt="logo" />
          <Link className="home" to="/">HOME</Link>
          <Link className="event" to="/events">EVENTS</Link>
          <Link className="booking" to="/booking">BOOKING</Link>
          <Link className="login" to="/login">LOGIN</Link>
          <Link className="contact" to="/contact">CONTACT</Link>
        </div>

        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/events" element={<Event />} />
            <Route path="/booking" element={<Book />} />
            <Route path="/login" element={<Log />} />
            {/* You can add a Contact component here if you have one */}
            {/* <Route path="/contact" element={<Contact />} /> */}
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
